import React, { useState} from 'react';

const AddBox = () =>{
   // console.log(lng);
    const [val, setValue] = useState("");
    const style = {
        position:'absolute',
        width:'330px',
        height:'330px',
        margin:'50px 50px',
        backgroundColor:'#FFF',
        boxShadow:'0 1px 2px rgba(0,0,0,.1)',
        borderRadius:'3px',
        textAlign:'center',
        paddingTop:'30px'
    }
    const handleChange = (e) =>{
        setValue(e.target.value)
    }
    return (
        <div style= {style}>
            <input type="text" placeholder="enter title" style={{
                                width:'90%',
                                height:'25px',
                                marginBottom:'10px'
                            }}  />
            <input type="text" placeholder="enter latitude" style={{
                                width:'40%',
                                height:'25px',
                                marginBottom:'10px',
                                marginRight:'20px'
                            }}  />
            <input type="text" placeholder="enter longtiude" style={{
                                width:'40%',
                                height:'25px',
                                marginBottom:'10px'
                            }}  />
            <input type="text" placeholder="enter comments" style={{
                                width:'90%',
                                height:'25px',
                                marginBottom:'10px'
                            }}  />
            <input type="text" placeholder="enter author" style={{
                                width:'90%',
                                height:'25px',
                                marginBottom:'10px'
                            }}  />
            <input type="text" placeholder="enter visit" style={{
                                width:'90%',
                                height:'25px',
                                marginBottom:'10px'
                            }}  />
            <input type="text" placeholder="enter image" style={{
                                width:'90%',
                                height:'25px',
                                marginBottom:'10px'
                            }}  />

            <button type="submit" 
            style={{
                padding:'5px 50px',
                marginTop:'5px',
                backgroundColor:'white',
                border:'1px solid black',
                borderRadius:'2px'
                }} >Mark it</button>

        </div>
    )
}
export default AddBox;
